import React, { useState } from "react";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

const Navbar = () => {
  const [collapsed, setCollapsed] = useState(true); // Initially collapsed
  const [searchQuery, setSearchQuery] = useState(""); // Track search query
  const [showSearch, setShowSearch] = useState(false); // Track visibility of search bar

  // Handle search bar visibility toggle
  const toggleSearch = () => {
    setShowSearch(!showSearch); // Toggle the search bar visibility
  };

  // Handle form submit
  const handleSearchSubmit = (e) => {
    e.preventDefault(); // Prevent form from reloading the page
    if (searchQuery) {
      console.log("Searching for:", searchQuery);
      // You can also redirect to a search results page
      // window.location.href = `/search?query=${searchQuery}`;
    }
  };

  return (
    <nav className="header_section navbar navbar-expand-lg custom_nav-container">
      <div className="container">
        {/* Brand */}
        <a className="navbar-brand" href="/">
          <span>NextBite</span>
        </a>

        {/* Toggler Button */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded={!collapsed} // Bind this to collapsed state
          aria-label="Toggle navigation"
          onClick={() => setCollapsed(!collapsed)} // Toggle collapse state
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Collapsible Content */}
        <div
          className={`collapse navbar-collapse ${collapsed ? "" : "show"}`}
          id="navbarSupportedContent"
        >
          {/* Navbar Links */}
          <ul className="navbar-nav mx-auto">
            <li className="nav-item active">
              <Link className="nav-link" to="/" onClick={() => setCollapsed(true)}>
                Home <span className="sr-only">(current)</span>
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/menu" onClick={() => setCollapsed(true)}>
                Menu
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about" onClick={() => setCollapsed(true)}>
                About
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/book" onClick={() => setCollapsed(true)}>
                Book Table
              </Link>
            </li>
          </ul>

          {/* User Options */}
          <div className="user_option">
            <a href="/" className="user_link">
              <i className="fa fa-user" aria-hidden="true"></i>
            </a>
            <a className="cart_link" href="/">
              <i className="fa fa-shopping-cart" aria-hidden="true"></i>
            </a>

            {/* Search Icon to Toggle the Search Bar */}
            <a href="/" className="search_icon" onClick={toggleSearch}>
              <i className="fa fa-search" aria-hidden="true"></i>
            </a>

            {/* Search Bar with Close Button */}
            {showSearch && (
              <form className="form-inline" onSubmit={handleSearchSubmit}>
                <input
                  className="form-control me-2"
                  type="search"
                  placeholder="Search"
                  aria-label="Search"
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                />
                <button className="btn my-2 my-sm-0 nav_search-btn" type="submit">
                  <i className="fa fa-search" aria-hidden="true"></i>
                </button>
                {/* Close Button */}
                <button
                  type="button"
                  className="btn btn-close"
                  onClick={toggleSearch} // Close the search bar when clicked
                >
                  <i className="fa fa-times" aria-hidden="true"></i>
                </button>
              </form>
            )}

            <a href="/" className="order_online">
              Order Online
            </a>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
